import React, { useState } from 'react';
import xImg from '../../x.png'; 
import { Link } from 'react-router-dom';

function WritePage() {
  return (
    <div className="container2">
      <div className='x-box'>
        <Link to='/'><img src={xImg} className='x-img' /></Link>
      </div>
      <div className='title-box-write'>
        <h1 className='ft-big'>'@@님의 레시피를 소개해 주세요!'</h1>
      </div>
      <div className="write-box">
        <h1 className="ft-big">글쓰기</h1>
        {/* 글쓰기 폼을 여기에 추가하세요 */}
        <Link to="/home">
          <button className="orange-btn">홈으로</button>
        </Link>
      </div>
    </div>
  );
}

export default WritePage;
